import React from 'react';
import { Outlet, Link } from 'react-router-dom';

import AboutMe from './AboutMe';
import Town from "./MyTown";




const Navigater= () =>{
    return(
<>
      <nav>
        <ul>
          <li>
            <Link to="/">About Me</Link>
          </li>
          <li>
            <Link to="/hometown">My Town</Link>
          </li>
        </ul>
      </nav>

      <Outlet />
    </>
    );
}

export default Navigater;
